-- shop 데이터베이스 구조 내보내기
CREATE DATABASE IF NOT EXISTS `shop` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `shop`;

-- 테이블 shop.category 구조 내보내기
CREATE TABLE IF NOT EXISTS `category` (
  `category` varchar(50) NOT NULL,
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`category`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.category:~6 rows (대략적) 내보내기
DELETE FROM `category`;

-- 테이블 shop.customer 구조 내보내기
CREATE TABLE IF NOT EXISTS `customer` (
  `mail` varchar(50) NOT NULL,
  `pw` varchar(50) NOT NULL,
  `name` varchar(50) NOT NULL,
  `birth` date NOT NULL,
  `gender` enum('남','여') NOT NULL,
  `update_date` datetime NOT NULL DEFAULT current_timestamp(),
  `create_date` datetime NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.customer:~4 rows (대략적) 내보내기
DELETE FROM `customer`;

-- 테이블 shop.emp 구조 내보내기
CREATE TABLE IF NOT EXISTS `emp` (
  `emp_id` varchar(50) NOT NULL,
  `grade` int(11) NOT NULL DEFAULT 0,
  `emp_pw` varchar(50) NOT NULL DEFAULT '',
  `emp_name` varchar(50) DEFAULT NULL,
  `emp_job` varchar(50) NOT NULL,
  `hire_date` date NOT NULL,
  `update_date` datetime NOT NULL DEFAULT current_timestamp(),
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  `active` enum('ON','OFF') NOT NULL DEFAULT 'OFF',
  PRIMARY KEY (`emp_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.emp:~101 rows (대략적) 내보내기
DELETE FROM `emp`;

-- 테이블 shop.goods 구조 내보내기
CREATE TABLE IF NOT EXISTS `goods` (
  `goods_no` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(50) NOT NULL,
  `emp_id` varchar(50) NOT NULL,
  `goods_title` text NOT NULL,
  `filename` text NOT NULL DEFAULT 'default.jpg',
  `goods_content` text NOT NULL,
  `goods_price` int(11) NOT NULL,
  `goods_amount` int(11) NOT NULL,
  `update_date` datetime NOT NULL DEFAULT current_timestamp(),
  `create_date` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`goods_no`) USING BTREE,
  KEY `FK_goods_category` (`category`) USING BTREE,
  CONSTRAINT `FK_goods_category` FOREIGN KEY (`category`) REFERENCES `category` (`category`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=524 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 shop.goods:~500 rows (대략적) 내보내기
DELETE FROM `goods`;


